import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';

let currDate = new Date();
let currTime = currDate.getHours();

let greetColor;
let greetText;

if (currTime >= 1 && currTime <=11 ){
  greetColor = '#06b81d';
  greetText ='Good Morning';
}
else if (currTime >= 12 && currTime <= 19){
  greetColor = '#f78d14';
  greetText ='Good Afternoon';
}
else{
  greetColor = '#575553';
  greetText = 'Good Night';
}



ReactDOM.render(
  <>
      <div className = 'greet_div'>
          <h1>Hello Sir, <span style={{color:greetColor}}>{greetText}</span></h1>
      </div>

  </>,
  document.getElementById('root')
);
